  PRIMARY KEY (`message_id`),
  KEY `sender_id` (`sender_id`,`receiver_id`) USING BTREE,
  KEY `receiver_id` (`receiver_id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

