ize: 12px;\"><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../images/image/34191410944325.jpg\" title=\"3.jpg\"/></span></p><p><span style=\"font-size: 12px;\">2.6、设置短信发送</span></p><p><span style=\"font-size: 12px;\">填写接收短信的手机号码，选择是否发送短信</span></p><p><span style=\"font-size: 12px;\"><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../images/image/85651410944325.jpg\" title=\"4.jpg\"/></span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\">3、选择模板</span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\">点击店铺系统设置》店铺模板选择</span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\">可以选择不同风格的模板</span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\"><br/></span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\">4、申请店铺街</span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\">选择店铺的经营类型，填写店铺名称、标题、描述、标签，上传店铺海报，提交即可。网站方管理员审核通过后就可以在店铺街看到你的店铺展示啦</span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\">店铺是否出现在店铺街底部的推荐展示以及店铺的排列顺序请联系网站方协商修改。<br/></span></span></p><p><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../bdimages/upload1/20140917/1410944591861430.jpg\" title=\"5.jpg\"/><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\"></span></span></p><p><span style=\"font-size: 12px;\"><span style=\"font-size: 12px;\"><br/></span></span></p><p><span style=\"font-size: 12px;\">5、</span><span style=\"font-size: 12px;\">权限管理</span></p><p><span style=\"font-size: 12px;\">点击权限管理》管理员列表：增加新的管理员，并为其设置权限，选中哪个就拥有哪个权限</span></p><p><span style=\"font-size: 12px;\"><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../images/image/92821410944327.jpg\" title=\"6.jpg\"/></span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\">6、添加商品分类：该商品分类是本店铺的分类</span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\">7、添加商品，提交后等待网站方审核，审核通过后即可上架销售了</span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\">8、管理自己的用户评论和用户晒单</span></p><p><span style=\"font-size: 12px;\"><br/></span></p><p><span style=\"font-size: 12px;\">9、促销管理：增加自己店铺的促销活动以及店铺红包</span></p><p><span style=\"font-size: 12px;\">9.1、促销活动：该促销活动有三种“满X元减Y元”、“满X元打Y折”、“满X元赠送YY、ZZ商品”</span></p><p style=\"text-align: left;\"><span style=\"font-size: 12px; color: rgb(127, 127, 127);\">图 促销活动</span></p><p><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../images/image/54341410944319.jpg\" style=\"float:none;\" title=\"7.jpg\"/></p><p><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">9.2、</span><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">红包类型：该红包类型有四种：“按用户发放”、“按商品发放”、“按订单金额发放”、“线下发放的红包”</span></p><p><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">9.2.1、按用户发放：可以控制该红包发送给哪些会员</span></p><p><span style=\"font-size: 12px; color: rgb(0, 0, 0);\"></span><span style=\"font-size: 12px; color: rgb(127, 127, 127);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">9.2.2、按商品方法：可以控制用户购买哪些商品时可以获得该红包</span></span></p><p><span style=\"font-size: 12px; color: rgb(127, 127, 127);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">9.2.3、按订单金额方法：可以控制用户购买商品满多少元时可以获得该红包</span></span></span></p><p><span style=\"font-size: 12px; color: rgb(127, 127, 127);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\"><span style=\"font-size: 12px; color: rgb(0, 0, 0);\">9.2.4、线下发放：属于线下发放的红包，直接将该红包序列号发送给用户，用户凭借该序列号即可使用该红包了</span></span></span></span></p><p><span style=\"font-size: 12px; color: rgb(127, 127, 127);\">图 红包类型</span><br/></p><p><span style=\"font-size: 12px;\"><img src=\"http://xjd.68ecshop.com/includes/ueditor/php/../../../bdimages/upload1/20140917/1410944574454318.jpg\" title=\"8.jpg\"/></span><br/></p>','','','',0,0,0,1410944026,'',0,'http://','',0),(80,20,'广告1','','','','',0,0,0,1437334217,'data/article/1437603513188688137.jpg',1,'http://','',0),(81,20,'广告2','','','','',0,0,0,1437334225,'data/article/1437334690546712289.jpg',1,'http://','',1),(82,20,'广告3','','','','',0,0,0,1437334250,'data/article/1437334700595779668.jpg',1,'http://','',0),(83,20,'广告4','','','','',0,0,0,1437334258,'data/article/1437334712958170263.jpg',1,'http://','',0),(84,20,'广告5','','','','',0,0,0,1437334269,'data/article/1437334721101005376.jpg',1,'http://','',0),(92,17,'广告通栏1','','','','',0,0,0,1437343954,'data/article/1437442307400141231.jpg',1,'http://','',0),(93,17,'广告通栏2','','','','',0,0,0,1437343982,'data/article/1437442318510034222.jpg',1,'http://','',0),(132,12,'在线商城','<p>欢迎订购在线商城</p>','','','在线商城',0,1,0,1459318550,'',0,'http://','在线商城',0),(133,19,'关于南宁市内送货通知','<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 尊敬的客户，即日起，南宁市内客户须单笔购满500元，即可免费送货上门，单笔未购满500元，均自行负责送货费用或自提。特此告知。</p>','','','',0,1,0,1466470657,'',0,'http://','',0),(134,19,'茶的回归：从线上走回线下，茶叶店重唤新生','<p><img style=\"WIDTH: 831px; FLOAT: none; HEIGHT: 541px\" title=\"ia2.jpg\" src=\"/includes/ueditor/php/../../../images/image/12471471079690.jpg\" width=\"1082\" height=\"891\"/></p><p style=\"TEXT-ALIGN: left; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 12px/24px Tahoma, Arial, Sans-Serif; WHITE-SPACE: normal; COLOR: rgb(51,51,51); WORD-SPACING: 0px; PADDING-TOP: 0px; -webkit-text-stroke-width: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: medium; PADDING-TOP: 0px\">　　继今年二月份雷军领衔的顺为资本再次投资中国茶产业互联网+领导平台醉品商城后，雷军进军茶产业的消息便在行业内被频繁流转，不绝于耳。此外，与雷军坦言小米将主攻线下店相一致的是，作为线上茶行业全产业链标杆，醉品商城也已借助其旗下的茶帮通及醉品朴茶(线下体验店品牌)两个品牌快速布局线下茶叶市场，并于6月份完成了醉品朴茶山东区域的招商。</span></p><p style=\"PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 12px/24px Tahoma, Arial, Sans-Serif; WHITE-SPACE: normal; COLOR: rgb(51,51,51); WORD-SPACING: 0px; PADDING-TOP: 0px; -webkit-text-stroke-width: 0px\">&nbsp;</p><p style=\"PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 12px/24px Tahoma, Arial, Sans-Serif; WHITE-SPACE: normal; COLOR: rgb(51,51,51); WORD-SPACING: 0px; PADDING-TOP: 0px; -webkit-text-stroke-width: 0px\"><span style=\"PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: medium; PADDING-TOP: 0px\">　　电商市场增速从2015年开始下滑，电商红利逐渐消失，市场趋向稳定，而这对于主攻线上的互联网企业来说着实是一个不小的打击。对此，小米科技联合创始人兼副总裁黎万强在接受《每日经济新闻》记者采访时表示，小米现在要多条腿走路补短板。为此小米不但在线下铺设自营小米之家，还与联通等合作定制机，在联通线下营业厅销售小米手机，多角度拓展销售渠道。而对于醉品商城而言，看似如出一辙的线下门店推广，是否也可以理解是为了企业渠道的延伸呢?笔者认为，并不然是这样，而这更像是一种产业的回归。</span></p><p><img style=\"FLOAT: none\" title=\"ia.jpg\" src=\"/includes/ueditor/php/../../../images/image/64891471079690.jpg\" width=\"848\" height=\"612\"/></p><p><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: medium/24px Tahoma, Arial, Sans-Serif; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　早先我们就已经知道，顺为资本之所以选择醉品作为其投资农业互联网+的一个重点项目，正是看中其利用互联网科技整合并联结了茶产业链条上的各环，如茶叶原产区生产商、茶产区政府、行业专家、茶叶门店、终端消费者等，解决了目前中国茶所存在的诸如信息闭塞、思维落后、营销薄弱等产业痛点，可有效推动产业的转型升级。而现在布局的线下店笔者之所以将其认为是一种回归，是因为回归茶自身的属性，线上开始逐步转化成一种服务于线下的工具。因为，茶无论是作为快消品还是文化之韵，终究都是品以口鉴的日常食物。无论是冷饮店还是茶馆又或者是茶叶店，得以触手可及或小聚翘首或品饮选购，线下门店都会是最接近生活形态的存在方式。而无论线上还是线下都不过是为了强化更好的用户体验。线上与线下各据两方，服务不同的人群需求。而这与阿里集团、京东等电商平台无论拥有多大的市场份额，万达、沃尔玛等线下商超仍旧占据城市中心一样，线上跟线下都无法完成完全的相互取代，却是互补的必要环节。此外，醉品除了欲开设样板店外，所有的线下茶叶店渠道都将假手于现有的线下茶叶店，现有茶叶店聚集了目前中国直面了最精准的茶叶消费人群，就此着手，不但可以迅速影响茶产业内的核心人群，更可进一步高效完善产业的专业化分工，以便在未来快速实现我国茶产业重构信息平衡，重构产业分工，重构流通结构等产业革新。</span></p><p>&nbsp;</p>','中国网','','',0,1,0,1471050917,'',0,'http://','继今年二月份雷军领衔的顺为资本再次投资中国茶产业互联网+领导平台醉品商城后，雷军进军茶产业的消息便在行业内被频繁流转，不绝于耳。',0),(136,19,'如何使你的茶具更健康','<p><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 36px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 18px/32px 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　一般很多人都会用钢丝球(清洁球)或是丝瓜等比较粗糙的清洗工具来刷洗茶具，这样是可以起到清洗的效果，但试想一下用这些比较粗糙的工具来清洗你的茶具，会很容易伤害茶具表面的釉质，使之变得越来越薄。慢慢地，这些茶垢就会完全渗入到茶具里面，那样茶具就会变成茶汤的颜色了，而且怎么也清洗不掉了。</span></p><p><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 36px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 18px/32px 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"><span style=\"TEXT-ALIGN: justify; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 18px/32px 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　最好的清洗方法是在每次喝完茶后，记得把茶叶倒掉，把茶具用水清洗干净。能够长期保持这种良好习惯的话，什么清洗工具都不用，茶具则可以保持明亮光泽。但有很多朋友都是喝完茶后就去休息或是做别的事情，清洗茶具的事情就忘记了，等到下次品茶的时候再来清洗茶具。这样经过长时间的浸泡，很多茶具都上了茶色，用清水是洗不掉的。这个时候，可以挤少量的牙膏在茶具上面，用手或是棉花棒把牙膏均匀地涂在茶具表面。大约过一分钟后再来用水清洗这些茶具，这样，茶具上面的茶垢就很容易被清洗干净了。用牙膏清洗，不会损坏茶具或伤害手，既方便又简单，茶友们都可以试试看。</span><br style=\"TEXT-ALIGN: justify; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; FONT: 18px/32px 宋体; WHITE-SPACE: normal; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"/><span style=\"TEXT-ALIGN: justify; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 18px/32px 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　茶具上的茶垢愈厚，泡出来的茶不见得愈健康或是香纯。常会听爱泡茶的老人家拿出心爱的茶壶，乌黑油亮的茶垢，似乎茶垢愈厚愈值钱。茶垢对人体健康是极为不利的。因此，爱喝茶也应该勤于刷洗茶具，才是良好的生活习惯。</span><br style=\"TEXT-ALIGN: justify; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; FONT: 18px/32px 宋体; WHITE-SPACE: normal; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"/><span style=\"TEXT-ALIGN: justify; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 18px/32px 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(0,0,0); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　（记者祝田园整理）</span></span></p>','济南时报(济南)','','',0,1,0,1471228053,'',0,'http://','',0),(137,19,'做茶叶代理需要了解的几大事宜','<p style=\"BORDER-BOTTOM: 0px; TEXT-ALIGN: center; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\"><img title=\"mp49216957_1450403755896_1_th.jpeg\" src=\"/includes/ueditor/php/../../../bdimages/upload1/20160823/1471937082568148.jpeg\"/></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<span style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; BORDER-TOP: 0px; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">前面小编给大家说到如何将茶叶代理发展成为自己一生的事业，今天小编就给大家讲一讲做好茶叶代理要注意的事情，大家脑袋里都会浮现出这样的问题，茶叶这个行业赚钱吗？怎样成为茶叶代理商呢？我想这一连串问题都是想做茶叶代理的创业者最关心的，也是最想解决的问题。</span></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<span style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">茶叶这个行业如今是非常热门的，因为茶叶是世界第一大保健饮品，这已经被世人所皆知，茶叶是中国最适合打造世界品牌的产业，是永不衰败的健康型产业，所以茶叶代理赚钱毋庸置疑，可以放心的去进行投资。既然选择了这个行业，那么选择怎样的方式开始创业呢？选择茶叶代理这种方式最直接，对有无经验的要求很低，而且代理以后有专业的培训师可以培训，易上手，创业者如果选择茶叶代理的形式会很容易创业成功，加盟优势主要体验在茶叶质量和加盟的政策上面，之所以说茶叶质量，主要是产品包装好，质量不好在市场上无人问津，当然也会大大的影响销量。政策方面根据不同的公司都会进行一些相应的政策优惠。</span></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<span style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">上述介绍了做茶叶代理需要了解的几大事宜，创业者在考虑产品的同时一定要选择有一家有实力的公司进行茶叶代理，在品牌、质量和售后等方面也能得到更好的保证。</span></span></p><p></p>','搜狐公众平台','','茶叶 代理 创业',0,1,0,1471908288,'',0,'http://','茶叶 代理 创业',0),(138,19,'好茶适宜淡品 大量喝浓茶对身体有害处','<p dir=\"ltr\"><span style=\"FONT-SIZE: 16px\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 14px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　【</span><span style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 0px; -webkit-text-stroke-width: 0px\">一道茶网 茶文化</span><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 14px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">】小编在泡茶的时候经常会遇到“众口难调”的问题。茶叶太淡，有些人认为茶之无味，茶叶太浓，有的人会认为又苦又涩，甚至爱喝浓茶的人和爱喝淡茶的人分为两大帮派互不服气。那作为泡茶人，我们应该如何去判断茶的味道是越浓越好还是越淡越好呢？</span></span></p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p style=\"TEXT-ALIGN: center\" dir=\"ltr\"><img style=\"FLOAT: none\" title=\"d30178744646476183c620b61ad77825_th.jpg\" src=\"/includes/ueditor/php/../../../images/image/42711471937223.jpg\"/></p><p>&nbsp;</p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　喝茶</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　小编认为，虽然众口难调，但还是淡茶为好。茶汤味道的浓淡，有一部分是取决于茶碱与芳香物质的含量。不管茶碱的浸出含量有多少，都是有提神醒脑的效果的，而且所含的营养物质并不低于浓茶。但如果喝大量的浓茶，会很容易刺激神经，导致精神高度兴奋、引起失眠的状况，对身体也非常的不利。</span></p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p style=\"TEXT-ALIGN: center\" dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"><img style=\"FLOAT: none\" title=\"f6d6d4a7c0134f87b28255aaece7cf53_th.jpg\" src=\"/includes/ueditor/php/../../../images/image/46361471937223.jpg\"/></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　喝浓茶对身体不利</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　许多茶友喝茶都有一些年头了，淡茶已经满足不了他们的口味，才渐渐地钟爱起浓茶。可能是日常生活的辣食口味，会让人觉得口重，认为浓饮才够刺激，毕竟喝茶追求的是茶的</span><a style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(0,112,192); FONT-SIZE: 16px; BORDER-TOP: 0px; BORDER-RIGHT: 0px; TEXT-DECORATION: underline; PADDING-TOP: 0px\" href=\"http://www.edaocha.com/baike/20151107/27932_1.html\"><span style=\"FONT-SIZE: 16px\">滋味</span></a><span style=\"FONT-SIZE: 16px\">。但从茶叶成分来说，</span><a style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; COLOR: rgb(0,112,192); FONT-SIZE: 16px; BORDER-TOP: 0px; BORDER-RIGHT: 0px; TEXT-DECORATION: underline; PADDING-TOP: 0px\" href=\"http://www.edaocha.com/baike/20151107/27907_1.html\"><span style=\"FONT-SIZE: 16px\">茶氨酸</span></a><span style=\"FONT-SIZE: 16px\">含量越高，茶的甜度与鲜爽度就越高，苦涩度越低，顺滑度高，就会让你觉得味淡了，但这种淡是茶叶质量好的表现，味浓了，茶的真味反而会被其他物质夺走，这就是我们所说浓茶夺香的道理。</span></p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　茶宜淡品</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　虽然浓茶满足了许多口味比较重的茶友，但小编不提倡喝浓茶，经常喝浓茶，会特别容易刺激胃。因为茶叶中大量的茶碱浸出后会刺激胃黏膜，会造成胃酸分泌过多的情况。所以一般情况下有胃溃疡和十二指肠的患者是一定要忌饮浓茶的，尤其是女性在生理期或孕期的时候，更是要忌饮浓茶。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　茶友中喜欢喝浓茶的也占了一大部分，但小编提倡，茶虽好，易淡品，从我们自身的健康考虑，一些对喝茶有所误解的茶友们，要清楚的了解正确喝茶的科学性，我们应该要尽量避开浓茶，选择淡茶。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\" dir=\"ltr\"><span style=\"FONT-SIZE: 16px\">　　（文/鹿与茶）</span></p><p dir=\"ltr\"><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\"></span>&nbsp;</p>','搜狐公众平台','','茶 浓茶 茶叶',0,1,0,1471908438,'',0,'http://','',0),(139,19,'喝茶对身体有什么好处_喝茶的7大好处','<p><span style=\"WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; LETTER-SPACING: normal; DISPLAY: inline !important; FONT: 16px/26px 微软雅黑, 宋体; WHITE-SPACE: normal; FLOAT: none; COLOR: rgb(51,51,51); WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">　　季节交替,空气干燥,人也容易急躁,此时饮茶养生讲究温润之道。</span></p><p style=\"TEXT-ALIGN: center\"><img style=\"FLOAT: none\" title=\"146371638166677543.JPEG\" src=\"/includes/ueditor/php/../../../images/image/55711472012130.jpeg\"/></p><p>&nbsp;</p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">喝茶的七大好处</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　多喝茶，好处多。据国外媒体最新报道，每天喝三杯茶，可发挥多种抗病保健效果。专家建议，早中晚各一杯茶，泡茶时间至少5分钟，让茶叶中的有效成分溶于热水中。红茶、绿茶、白茶和乌龙茶四种主要茶叶中都含有促进健康的多种抗氧化剂。由于牛奶中的蛋白质的缘故，喝茶加牛奶更有利于发挥茶叶保健作用，但是加糖则没有这种效果。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">1、降低中风危险</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　荷兰一项为期15年的研究发现，常喝不加牛奶红茶可降低中风危险。美国研究发现，5倍红茶中的茶多酚可使坏胆固醇降低11%,进而降低中风和心脏病风险。茶多酚还具有改善血管功能的作用。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">2、促进消化功能</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　绿茶(未经过加工处理)有助于刺激肠道蠕动，促进食物消化。绿茶还可以阻止30%的脂肪吸收，具有减肥功效。薄荷茶可促进消化，姜茶可治反胃(特别是妊娠反应)，茴香茶可防止便秘、胃肠胀气和腹绞痛。3、脑子更灵活英国研究发现，红茶中的咖啡因和L-茶氨酸可提高认知能力，喝两倍红茶即可改善注意力。另外，每天喝茶(或咖啡)100毫升以上，可以使用神经胶质瘤(最常见的脑肿瘤)危险降低34%。</span></p><p>&nbsp;</p><p style=\"TEXT-ALIGN: center\"><img style=\"FLOAT: none\" title=\"146371638183299419.JPEG\" src=\"/includes/ueditor/php/../../../images/image/55141472012130.jpeg\"/></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">4、降低癌风险</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　茶叶(尤其是绿茶)中多酚类抗氧化剂含量是水果蔬菜的8倍，该物质可阻止癌细胞生长。台湾研究发现，每天1杯绿茶可降低肺癌危险。另外喝茶还可减缓前列腺癌进程，降低胃癌风险。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">5、增强免疫力</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　哈佛大学研究发现，每天喝茶5-6杯的人免疫力会明显改善，新陈代谢和皮肤健康也更好。喝茶还有助人体识别并抗击细菌和寄生虫。姜茶具有抗炎、镇痛和刺激循环作用，可缓解偏头痛。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">6、治疗失眠焦虑</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　红茶中咖啡因含量较高，睡前最好别喝。但大多数草药茶不含咖啡因。甘菊茶中的色氨酸和氨基酸可发挥镇定作用，另一种物质柯因(chrysin)可缓解焦虑促进睡眠，治疗失眠症。另外，薰衣草花茶可缓解放松身心。罗勒叶茶具有镇静作用。</span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　<strong style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; MARGIN: 0px; PADDING-LEFT: 0px; PADDING-RIGHT: 0px; FONT-SIZE: 14px; BORDER-TOP: 0px; FONT-WEIGHT: bold; BORDER-RIGHT: 0px; PADDING-TOP: 0px\">7、保护牙齿</strong></span></p><p style=\"BORDER-BOTTOM: 0px; BORDER-LEFT: 0px; PADDING-BOTTOM: 0px; WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; MARGIN: 0px; PADDING-LEFT: 0px; LETTER-SPACING: normal; PADDING-RIGHT: 0px; FONT: 14px/26px 微软雅黑, 宋体; WORD-WRAP: break-word; WHITE-SPACE: normal; COLOR: rgb(51,51,51); BORDER-TOP: 0px; BORDER-RIGHT: 0px; WORD-SPACING: 0px; PADDING-TOP: 26px; -webkit-text-stroke-width: 0px\"><span style=\"FONT-SIZE: 16px\">　　虽然喝茶会导致牙齿变色，但是茶多酚可抗菌防止牙结石，防止牙病和龋齿。白茶和绿茶都有这种作用。果茶呈酸性，会破坏牙釉质。</span></p>','狐公众平台','','',0,1,0,1471983344,'',0,'http://','',0),(140,16,'喜迎中秋，满减不断 好礼连连','<p style=\"TEXT-ALIGN: center\"><img title=\"609495116462494588.jpg\" src=\"/includes/ueditor/php/../../../bdimages/upload1/20160824/1472012550420420.jpg\"/></p>','月梦网络','','',0,1,0,1471983769,'data/article/1471983769696839628.jpg',2,'http://','',0),(141,19,'亲！活动开始啦！喜迎中秋，满减不断 好礼连连','<p><a href=\"\" target=\"_self\"><img title=\"405089186882077828.jpg\" src=\"/includes/ueditor/php/../../../bdimages/upload1/20160825/1472108287260471.jpg\"/></a></p>','月梦网络','','喜迎中秋,活动',0,1,0,1472079531,'data/article/1472079531270406766.jpg',2,'http://','亲！活动开始啦！喜迎中秋，满减不断 好礼连连',0);
