INSERT INTO `ecs_payment` VALUES (1,'alipay','支付宝','0','支付宝网站(www.alipay.com) 是国内先进的网上支付平台。<br/>支付宝收款接口：在线即可开通，<font color=\"red\"><b>零预付，免年费</b></font>，单笔阶梯费率，无流量限制。<br/><font color=\"red\">注意:申请时请选择\"即时到帐\"业务进行申请</font><br/>',0,'a:4:{i:0;a:3:{s:4:\"name\";s:14:\"alipay_account\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:24:\"marketing@linkall.cn.com\";}i:1;a:3:{s:4:\"name\";s:10:\"alipay_key\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:32:\"fvievfk4pmkqokm9b405sk1u6g4j46mx\";}i:2;a:3:{s:4:\"name\";s:14:\"alipay_partner\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:16:\"2088921778526331\";}i:3;a:3:{s:4:\"name\";s:17:\"alipay_pay_method\";s:4:\"type\";s:6:\"select\";s:5:\"value\";s:1:\"2\";}}',1,0,1,0),(2,'unionpay','中国银联全渠道商户','0','申请全渠道相关信息与相关信息请查看链接:https://merchant.unionpay.com/portal/login.jsp?locale=zh_CN',0,'a:3:{i:0;a:3:{s:4:\"name\";s:16:\"unionpay_account\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:15:\"802350259770501\";}i:1;a:3:{s:4:\"name\";s:18:\"SDK_SIGN_CERT_PATH\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:55:\"./includes/modules/payment/unionpay/802350259770501.pfx\";}i:2;a:3:{s:4:\"name\";s:17:\"SDK_SIGN_CERT_PWD\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:7:\"a122906\";}}',0,0,1,0),(3,'balance','余额支付','0','使用帐户余额支付。只有会员才能使用，通过设置信用额度，可以透支。',0,'a:0:{}',1,0,1,0),(4,'cod','货到付款','0','开通城市：×××\n货到付款区域：×××',0,'a:0:{}',0,1,0,0),(5,'weixin','微信支付','0','微信支付 ',0,'a:4:{i:0;a:3:{s:4:\"name\";s:5:\"appId\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:18:\"wxad533f7c6334a27f\";}i:1;a:3:{s:4:\"name\";s:9:\"appSecret\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:32:\"7fdafa4ddfe260420cbc50de3cfe560c\";}i:2;a:3:{s:4:\"name\";s:9:\"partnerId\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:10:\"1497231192\";}i:3;a:3:{s:4:\"name\";s:10:\"partnerKey\";s:4:\"type\";s:4:\"text\";s:5:\"value\";s:32:\"rtadlllzonomk51ltikfbhrrlga25t4m\";}}',1,0,1,0);
