DROP TABLE IF EXISTS `ecs_seckill_activity`;
CREATE TABLE `ecs_seckill_activity` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL COMMENT '秒杀活动名称',
  `seckill_start_date` int(11) NOT NULL COMMENT '秒杀开始时间',
  `seckill_end_date` int(11) NOT NULL COMMENT '秒杀结束时间',
  `content` text NOT NULL,
  `img` varchar(255) DEFAULT NULL COMMENT '活动图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

