# Source for table "ecs_seckill_goods"
#

DROP TABLE IF EXISTS `ecs_seckill_goods`;
CREATE TABLE `ecs_seckill_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `is_seckill` tinyint(2) NOT NULL DEFAULT '0' COMMENT '1代表秒杀商品',
  `seckill_start_date` int(11) DEFAULT NULL COMMENT '秒杀开始时间',
  `seckill_end_date` int(11) DEFAULT NULL COMMENT '秒杀结束时间',
  `seckill_num` int(10) DEFAULT NULL COMMENT '秒杀数量',
  `seckill_price` decimal(10,2) DEFAULT NULL COMMENT '秒杀价格',
  `seckill_id` int(10) DEFAULT '0' COMMENT '如果该商品是秒杀商品，记录该商品是哪个秒杀活动的',
  `seckill_total_num` int(10) DEFAULT '0' COMMENT '实际设置的秒杀数量  不会随购买改变',
  `goods_id` int(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

