INSERT INTO `ecs_supplier_circle` VALUES (1,'商圈测试','湿哒哒嘎嘎东方红大风刮过过过过过过过过过过过过过','images/201907/1563445512158919123.jpg'),(2,'南京向南，百家湖见','南京新街口商圈被誉为“中华第一商圈”，除此之外，在区域商业的发展过程中，百家湖等新兴商圈一路崛起。随着南京区划的调整和城市的发展，江宁已经成为南京版图的中心，百家湖商圈从自由竞争，到区域协同、抱团发展，成功探索了“政府+商会+企业”三位一体、良性互动的崛起模式，成为江宁乃至南京商业版图的亮点，渐成“南京第二商圈”、“第二个新街口”之势。','images/201907/1563951972206775205.jpg');

