DROP TABLE IF EXISTS `ecs_users`;
CREATE TABLE `ecs_users` (
  `user_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `aite_id` text CHARACTER SET utf8 NOT NULL,
  `email` varchar(60) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `user_name` varchar(60) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `password` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `is_surplus_open` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否开启余额支付密码功能',
  `surplus_password` varchar(32) CHARACTER SET utf8 NOT NULL COMMENT '余额支付密码',
  `question` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `answer` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `sex` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `birthday` date NOT NULL DEFAULT '0000-00-00',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00',
  `frozen_money` decimal(10,2) NOT NULL DEFAULT '0.00',
  `pay_points` int(10) unsigned NOT NULL DEFAULT '0',
  `rank_points` int(10) unsigned NOT NULL DEFAULT '0',
  `address_id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `reg_time` int(10) unsigned NOT NULL DEFAULT '0',
  `last_login` int(11) unsigned NOT NULL DEFAULT '0',
  `last_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_ip` varchar(15) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `visit_count` smallint(5) unsigned NOT NULL DEFAULT '0',
  `user_rank` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `is_special` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `ec_salt` varchar(10) CHARACTER SET utf8 DEFAULT NULL,
  `salt` varchar(10) CHARACTER SET utf8 NOT NULL DEFAULT '0',
  `parent_id` mediumint(9) NOT NULL DEFAULT '0',
  `flag` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `alias` varchar(60) CHARACTER SET utf8 NOT NULL,
  `msn` varchar(60) CHARACTER SET utf8 NOT NULL,
  `qq` varchar(20) CHARACTER SET utf8 NOT NULL,
  `office_phone` varchar(20) CHARACTER SET utf8 NOT NULL,
  `home_phone` varchar(20) CHARACTER SET utf8 NOT NULL,
  `mobile_phone` varchar(20) CHARACTER SET utf8 NOT NULL,
  `is_validated` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `validated` int(11) NOT NULL,
  `credit_line` decimal(10,2) unsigned NOT NULL,
  `passwd_question` varchar(50) CHARACTER SET utf8 DEFAULT NULL,
  `passwd_answer` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `is_fenxiao` tinyint(1) NOT NULL,
  `real_name` varchar(255) CHARACTER SET utf8 NOT NULL,
  `card` varchar(255) CHARACTER SET utf8 NOT NULL,
  `face_card` varchar(255) CHARACTER SET utf8 NOT NULL,
  `back_card` varchar(255) CHARACTER SET utf8 NOT NULL,
  `country` int(11) NOT NULL,
  `province` int(11) NOT NULL,
  `city` int(11) NOT NULL,
  `district` int(11) NOT NULL,
  `address` varchar(255) CHARACTER SET utf8 NOT NULL,
  `status` int(11) NOT NULL,
  `mediaUID` varchar(50) CHARACTER SET utf8 NOT NULL,
  `mediaID` int(4) NOT NULL,
  `froms` char(10) CHARACTER SET utf8 NOT NULL DEFAULT 'pc' COMMENT 'pc:电脑,mobile:手机,app:应用',
  `headimg` varchar(255) CHARACTER SET utf8 NOT NULL,
  `remarks` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '备注',
  `sync_erp` tinyint(2) unsigned DEFAULT '0',
  `sync_result` varchar(150) CHARACTER SET utf8 DEFAULT NULL,
  `open_id` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT 'open_id',
  `avatar` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '头像地址',
  `portal_id` int(11) NOT NULL DEFAULT '0',
  `is_ad_user` tinyint(1) NOT NULL DEFAULT '0',
  `passwd_weixin` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `supplierId` int(11) NOT NULL DEFAULT '0',
  `is_old` tinyint(2) unsigned DEFAULT '0' COMMENT '是否老会员，默认为否',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `user_name` (`user_name`) USING BTREE,
  KEY `email` (`email`) USING BTREE,
  KEY `parent_id` (`parent_id`) USING BTREE,
  KEY `flag` (`flag`) USING BTREE,
  KEY `mediaUID` (`mediaUID`,`mediaID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=2772 DEFAULT CHARSET=utf8mb4;

